package javacorepractice.practiceString;

public class SwapString {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		String S1 = "Anusha";
		String S2 = "Chetan";
		String S3 = "";
		
		S3 = S1;
		S1 = S2;
		S2 = S3;
		
		System.out.println(S1);
		System.out.println(S2);

	}

}
